import React, { ReactElement } from 'react';
import { RouteComponentProps } from '@reach/router';

import { Card, Head } from '@/components/common';
import processes from '@/mock-files/processes.json';
import laptopImageSrc from '@/assets/images/laptop.png';
import './styles.scss';

function HomePage(props: RouteComponentProps): ReactElement {
  return (
    <>
      <Head
        title="Home Page"
        description="General content about the site"
      />
      <main>
        <section className="processes-page__introduction-container">
          <div className='processes-page__content-container'>
            {processes.map((item) => (
              <span key={`${new Date().getMilliseconds()}${Math.random()}`}>
                <Card title={item.title} text={item.text} />
              </span>
            ))}
          </div>
        </section>
      </main>
    </>
  );
}

export default HomePage;
